import React from "react";

const Header = () => {
  return (
    <div className="ui fixed menu">
      <div
        className="ui container center"
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100%",
        }}
      >
        <h2>Contact Manager</h2>
      </div>
    </div>
  );
};

export default Header;
